import gmpy2
def I_T(number, size):
    """Convert an integer into a text string"""
    text = "".join([chr((number >> j) & 0xff) for j in reversed(range(0, size << 3, 8))])
    return text.lstrip("\x00")
def d_code(no,e):
	m = int(gmpy2.iroot(gmpy2.mpz(no),e)[0])
	size = len(str(m))
	return I_T(m,size)

